class MarkerItem extends React.Component {
	constructor(){
		super();
		this.state={
			opacity:1
		}
	}
	componentDidUpdate(prevProps,prevState){
		if (prevProps.opacity !== this.props.opacity) {
			this.setState({opacity:this.props.opacity})
		}
	}
	render() {
   		let position = [parseFloat(this.props.data.lat),parseFloat(this.props.data.lng)];
   		let icon = L.icon({
   			iconUrl: 'assets/marker-icon.png'
   		});
   		console.log(position);
		return (
			<Marker position={position} icon={icon} opacity={this.state.opacity}>
				<Popup>
					<span>{this.props.data.name}</span>
				</Popup>
			</Marker>
		);
	}
}

class AlertItem extends React.Component {
	constructor(){
		super();
		this.state={
			opacity:1
		}
	}
	componentDidUpdate(prevProps,prevState){
		if (prevProps.opacity !== this.props.opacity) {
			this.setState({opacity:this.props.opacity})
		}
	}
	render() {
   		let position = [parseFloat(this.props.data.location.x),parseFloat(this.props.data.location.y)];
   		let icon = L.icon({
   			iconUrl: 'assets/marker-alert.png'
   		});
   		console.log(position);
		return (
			<Marker position={position} icon={icon} opacity={this.state.opacity}>
				<Popup>
					<span>{this.props.data.type}</span>
				</Popup>
			</Marker>
		);
	}
}

